import React from 'react'
import { useState } from 'react';
import './Calcluation.css';
import Button from '../Button/Button'

const Calcluation = () => {
    const [count,setCount] =useState(0);

    const decrementCount=()=>{
        setCount(countValue =>countValue-1)
    }
    const incrementCount=()=>{
        setCount(countValue =>countValue+1)
    }
  return (
    <div className='formWork'>
      <h1>Todo-List</h1>
      <span>{count}</span>
      <Button name ="-" class="calcluateButton" onClick={decrementCount}/>
      <Button name ="+" class="calcluateButton"onClick={incrementCount}/>
    </div>
  )
}

export default Calcluation
